import { IconButton } from "@mui/material";
import ROUTES from "../routes/ROUTES";
import InfoIcon from "@mui/icons-material/Info";
import FavoriteIcon from "@mui/icons-material/Favorite";
import PortraitIcon from "@mui/icons-material/Portrait";

const myLinks = [
  // <IconButton to={ROUTES.ABOUT} key="About" children="About">
  //   About
  //   <InfoIcon />
  // </IconButton>,
  // <IconButton to={ROUTES.FAVCARD} key="Fav Cards" children="Fav Cards">
  //   Favorite
  //   <FavoriteIcon />
  // </IconButton>,
  // <IconButton to={ROUTES.MYCARDS} key="My-Cards" children=" My Cards">
  //   My Cards
  //   <PortraitIcon />
  // </IconButton>,
];

const alwaysLinks = [
  { to: ROUTES.HOME, children: "Home page" },
  { to: ROUTES.ABOUT, children: "About" },
];

const loggedOutLinks = [
  { to: ROUTES.REGISTER, children: "Register" },
  { to: ROUTES.LOGIN, children: "Login" },
];

const loggedInLinks = [];

const isBusiness = [
  { to: ROUTES.FAVCARD, children: "Fav Cards" },
  { to: ROUTES.MYCARDS, children: "My Cards" },
];

const isAdmin = [
  { to: ROUTES.FAVCARD, children: "Fav Cards" },
  { to: ROUTES.MYCARDS, children: "My Cards" },
  { to: ROUTES.SANDBOX, children: "Sandbox" },
];

const UserLinks = ({ isBusiness, isAdmin }) => {
  if (isBusiness && isAdmin) {
    return isAdmin;
  } else {
    return isBusiness;
  }
};

export default myLinks;
export {
  alwaysLinks,
  loggedInLinks,
  loggedOutLinks,
  isBusiness,
  isAdmin,
  UserLinks,
};
